    sensor(integer n)
    {
        key owner = llGetOwner();
	
        while(~--n)
        {
			key detectedKey = llDetectedKey(n);
            if ( detectedKey != owner  )
            {
                integer i;

                for(; i <= n && detectedKey != NULL_KEY; ++i) {
