#include <bits/stdc++.h>
    
using namespace std;
    
typedef long long int ll;
    
int main() {
  ios::sync_with_stdio(false);
  cin.tie(NULL);
  
  ll qa, qb, sa, sb, w, n, m;
  
  cin >> qa >> qb >> sa >> sb >> w >> n >> m;
  
  ll bob_time = qb * sb + sb + w;
  ll alice_time = qa * sa + sa + w;

  vector<ll> aliceq(n), bobq(m);

  for (int i = 0; i < n; ++i) {
    cin >> aliceq[i];
  }

  for (int i = 0; i < m; ++i) {
    cin >> bobq[i];
  }

  ll ansBob = -1;
  ll last = qb * sb;

  for (int i = 0; i < m; ++i) {
    ll x = bobq[i];

    if (x > alice_time) {
      if (alice_time < last) {
        ansBob = last + sb;
      } else {
        ansBob = alice_time + sb;
      }

      break;
    }

    if (x < last) {
      last += sb;
    } else {
      last = x + sb;
    }
  }

  if (ansBob == -1) {
    if (alice_time < last) {
      ansBob = last + sb;
    } else {
      ansBob = alice_time + sb;
    }
  }

  ll ansAlice = -1;
  last = qa * sa;

  for (int i = 0; i < n; ++i) {
    ll x = aliceq[i];

    if (x > bob_time) {
      if (bob_time < last) {
        ansAlice = last + sa;
      } else {
        ansAlice = bob_time + sa;
      }

      break;
    }

    if (x < last) {
      last += sa;
    } else {
      last = x + sa;
    }
  }

  if (ansAlice == -1) {
    if (bob_time < last) {
      ansAlice = last + sa;
    } else {
      ansAlice = bob_time + sa;
    }
  }

  // cout << alice_time << ' ' << ansAlice << '\n';
  // cout << bob_time << ' ' << ansBob << '\n';
  cout << min(ansAlice, ansBob) << '\n';
}

# sort and then use two pointers. avoiding duplicates was the real hassle. difficult implementation

class Solution:
    def threeSum(self, nums: List[int]) -> List[List[int]]:

        nums.sort()
        result = []
        nums = list(set(nums))

        for index, num in enumerate(nums):
            
            # not needed, it's optimisation over the current approach to save 
            # some computation time
            if num > 0:
                break

            # avoid duplicates
            if index!=0 and nums[index] == nums[index-1]:
                continue

            target = -num

            start = index + 1
            end = len(nums) - 1

            while(start < end):

                if nums[start] + nums[end] < target:
                    start = start + 1 
                elif nums[start] + nums[end] > target:
                    end = end - 1
                else:
                    result.append([nums[index], nums[start], nums[end]])
                    start = start + 1
                    end = end - 1

                    while(start < end and nums[start] == nums[start-1]):
                        start = start + 1

                    while(start < end and nums[end] == nums[end+1]):
                        end = end - 1

        return result

import json

from sqlalchemy.future import select
from starlette.endpoints import HTTPEndpoint
from starlette.requests import Request
