const ll N = 2e6+5;
vector<bool>isPrime(N,1);
vector<ll>gpf(N);
vector<ll>primes;
void sieve(){
    isPrime[0] = isPrime[1] = 0;
    for(ll i = 2; i < N; i++){
        if(isPrime[i]){
            primes.push_back(i);
            for(ll j = i*i; j < N; j+=i){
                isPrime[j] = 0;
            }
        }
    }

    for(auto&p:primes){
        for(ll j = p; j < N; j+=p){
            gpf[j] = p;
        }
    }

}

struct Data{
    ll val,idx;
    bool operator<(const Data&other)const{
        return (val<other.val||(val==other.val&&idx>other.idx));
    }
};


void solve(){

ll n,q; cin>>n>>q;
vector<ll>v(n);
for(auto&i:v)cin>>i;
ll cnt = 1;
vector<ll>time(n);

priority_queue<Data>pq;

for(ll i = 0;i<n;i++){
    pq.push({v[i],i});
}

while(!pq.empty()){
    auto cur = pq.top();
    pq.pop();
    cout<<cur.val<<" "<<cur.idx<<nl;
    time[cur.idx] = cnt;
    cur.val/=gpf[cur.val];
    if(cur.val>1)pq.push(cur);
    cnt++;
}

for(auto&i:time) cout<<i<<" ";
cout<<nl;



}
 
int main(){
    Fast_IO();
    sieve();
int t =1; 
//cin>>t;
while(t--){
solve();
}
return 0;
}

