prontera,128,213,5	script	TCG Banker	407,{
switch( select( "^0000FFDeposit^000000 "+.coin_name$,"^008000Withdraw^000000 "+.coin_name$ ) ){
	case 1:
		mes "How many "+.coin_name$+" to ^0000FFDeposit^000000 ??";
		mes "^FF0000Max^000000 : "+countitem( .coin_id )+" "+.coin_name$;
		input .@amount,0,countitem( .coin_id );
		if( .@amount ){
			delitem .coin_id,.@amount;
			#coin_bank += .@amount;
		}
		else{
			mes "^0000FFDeposit^000000 ^FF0000cancelled^000000.";
		}
		break;
	case 2:
		mes "How many "+.coin_name$+" to ^008000Withdraw^000000 ??";
		mes "^FF0000Max^000000 : "+#coin_bank+" "+.coin_name$;
		input .@amount,0,#coin_bank;
		if( .@amount ){
			getitem .coin_id,.@amount;
			#coin_bank -= .@amount;
		}
		else{
			mes "^008000Withdraw^000000 ^FF0000cancelled^000000.";
		}
		break;
}
close;

OnInit:
	.coin_id = 7227;
	.coin_name$ = getitemname( .coin_id );
	waitingroom "TCG Banker",0;
	end;
}

